import React from 'react';

function App() {
  let counter = 0;
  return (
    <div className="App">
      <button onClick={() => counter += 1}>Increment</button>
      <button onclick={() => counter -= 1}>Decrement</button>
      <div>
        <span>Counter: {counter}</span>
      </div>
    </div>
  );
}

export default App;
